contracts/CreatorCoin.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract CreatorToken is ERC20Upgradeable, UUPSUpgradeable, OwnableUpgradeable {

    struct CreatorDetails {
        string name;
        string image;
        string channelLink;
        uint256 subscribers;
        string milestone; // e.g., "10M Subscribers Badge"
    }

    mapping(address => CreatorDetails) public creatorInfo;
    mapping(string => bool) public isTokenMinted; // Prevent duplicate minting

    event CreatorTokenMinted(address indexed creator, string name, uint256 supply);
    event LargeTransaction(address indexed from, address indexed to, uint256 amount);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(address _admin) external initializer {
        __ERC20_init("CreatorToken", "CTK");
        __Ownable_init(_admin);
        __UUPSUpgradeable_init();
    }

    function mintToken(
        address creator,
        string memory name,
        string memory image,
        string memory channelLink,
        uint256 subscribers
    ) external onlyOwner {
        require(!isTokenMinted[name], "Token already minted for this creator");

        uint256 supplyCap = calculateSupply(subscribers);

        creatorInfo[creator] = CreatorDetails({
            name: name,
            image: image,
            channelLink: channelLink,
            subscribers: subscribers,
            milestone: getMilestone(subscribers)
        });

        isTokenMinted[name] = true;
        _mint(creator, supplyCap);

        emit CreatorTokenMinted(creator, name, supplyCap);
    }

    function calculateSupply(uint256 subscribers) internal pure returns (uint256) {
        return subscribers * 10**18; // 1 token per subscriber
    }

    function getMilestone(uint256 subscribers) internal pure returns (string memory) {
        if (subscribers >= 10000000) return "10M Subscribers Badge";
        if (subscribers >= 1000000) return "1M Subscribers Badge";
        if (subscribers >= 100000) return "100K Subscribers Badge";
        return "No Major Milestone";
    }

    function _authorizeUpgrade(address) internal override onlyOwner {}

    function transfer(address to, uint256 amount) public override returns (bool) {
        bool success = super.transfer(to, amount);
        if (amount >= 1000 * 10**18) {
            emit LargeTransaction(_msgSender(), to, amount);
        }
        return success;
    }
}

